const myPlaceFinder = (votes, myUID) => {
    console.log(votes, 'sdfsfsdf')
    const dict = {}
    votes.forEach(vote => {
        if (vote.receiverID in dict) {
            dict[vote.receiverID] = dict[vote.receiverID] + vote.value
        } else {
            dict[vote.receiverID] = vote.value
        }
    })
    var arr = []
    console.log(dict)
    for (let key in dict) {
        var obj = { uid: key, score: dict[key] }
        arr.push(obj)
    }
    // arr = arr.sort((a, b) => {
    //     if (a.score > b.score) {
    //         return -1
    //     } return 1
    // })
    var myPosition
    var myScore

    arr.forEach((item, index) => {
        if (item.uid === myUID) {
            myPosition = index + 1
            myScore = item.score
        }
    })
    // if you've received no votes
    if (!myPosition) {
        return arr.length + 1
    }
    return {
        myPos: myPosition,
        myScore: myScore
    }
}

export default {
    myPlaceFinder: myPlaceFinder
}
